import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import ReservationForm from './components/ReservationForm';
import ReservationList from './components/ReservationList';
import Login from './components/Login'; // optional

function App() {
  const refreshList = () => {
    // Optionally refresh reservation list after form submission
  };

  return (
    <Router>
      <Navbar />
      <div className="p-6">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/create" element={<ReservationForm onSuccess={refreshList} />} />
          <Route path="/all" element={<ReservationList />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
